import "./Login.css";
import logo from "./logo-insoft.png";
import 'bootstrap/dist/css/bootstrap.css';

function Login() {
  return (
    <div>
      <div className="login-wrapper">
        <img src={logo} alt="Logo insoft"></img>
        <h2>Portal de distribuidores</h2>
        <p>
          Bienvenido al portal de distribuidores de InSoft, por favor inicie
          sesi√≥n.
        </p>
        <form>
  <div class="form-group">
    <label for="exampleInputEmail1">Email address <input type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter email"> </input></label>

    <small id="emailHelp" class="form-text text-muted">We'll never share your email with anyone else.</small>
  </div>
  <div class="form-group">
    <label for="exampleInputPassword1">Password <input type="password" class="form-control" id="exampleInputPassword1" placeholder="Password"></input></label>

  </div>
  <button type="submit" class="btn btn-primary">Submit</button>
</form>
      </div>
    </div>
  );
}

export default Login;
